            var html_e436e1b5072b4af49d4de68800962a6c = $(`<div id="html_e436e1b5072b4af49d4de68800962a6c" style="width: 100.0%; height: 100.0%;"><h1>Орто-Токойское водохранилище</h1> <p> Водохранилище в Киргизии. Расположено на реке Шу в 2 км к западу от посёлка Орто-Токой, на границе Нарынской и Иссык-Кульской областей. Строительство начато в 1941 году, завершено в 1960 году. Высота над уровнем моря — 1700 м. Площадь водной поверхности — 26 км², объём — 470 млн м³. Длина — 18 км, наибольшая ширина — 5 км, максимальная глубина — 47 м. Высота плотины — 52 м, длина — 365 м, ширина — 6 м. Длина водосбросного тоннеля — 567 м, диаметр — 4,5 м. Расход воды — в среднем 12,8 м³/с. Регулирует сток реки Шу. Вода водохранилища используется для орошения 120 тыс. га сельскохозяйственных земель: 86 тыс. га в Киргизии, 34 тыс. га в Казахстане. </p> <img src='{% static 'images/Orto-Tokoy.JPG' %}'/></div>`)[0];
